import React from "react";
import ReactDOM from "react-dom";
import BigDisplay from "./bigDisplay";

export default class NetLayout extends React.Component {
  render() {
    return (
      <div>
        <div>
          <BigDisplay colour="1" />;
          <BigDisplay colour="0" />;
        </div>
        <BigDisplay colour="1" />;
        <BigDisplay colour="1" />;
        <BigDisplay colour="1" />;
      </div>
    );
  }
}
ReactDOM.render(<NetLayout />, document.getElementById("root"));
